import React, { Component } from "react";
import AlphaVantage from "../utils/apis/alphaVantage";
import { portifolio } from "../assets/config";
import { request } from "http";
// import "../assets/htmls/GOAU3.html";

class Companies extends Component {
  state = {
    quotes: null
  };

  async componentDidMount() {
    let quotes = [];
    for (let i = 0; i < portifolio.length; i++) {
      const response = await AlphaVantage.getCurrentQuote(portifolio[i]);
      quotes.push(response.data);
    }

    // console.log(
    //   request("http://www.fundamentus.com.br/detalhes.php?papel=GOAU3")
    // );

    this.setState({ quotes });
  }

  teste = () => {
    const $ = cheerio.load(
      "http://www.fundamentus.com.br/detalhes.php?papel=GOAU3"
    );
    return $.html();
  };

  render() {
    return (
      <div>
        {/* {JSON.stringify(this.state, null, 2)
          .split("\n")
          .map(l => (
            <div>{l}</div>
          ))} */}
        {this.teste()}
      </div>
    );
  }
}

export default Companies;
